import styled from 'styled-components';

const Wrapper = styled.div`
  text-align: center;

`

const index = () => {
  return (
    <Wrapper>
      <p>Hi</p>
      <img src="/comingSoon.jpg" alt=""/>
    </Wrapper>
  )
}

export default index;
